    class Container extends Component {

    	constructor(props) {
    		super(props);
    		this.state = { cards: props.list };
    	}

    	pushCard(card) {
    		this.setState(update(this.state, {
    			cards: {
    				$push: [ card ]
    			}
    		}));
    	}

    	removeCard(index) {
    		this.setState(update(this.state, {
    			cards: {
    				$splice: [
    					[index, 1]
    				]
    			}
    		}));
    	}

    	moveCard(dragIndex, hoverIndex) {
    		const { cards } = this.state;
    		const dragCard = cards[dragIndex];

    		this.setState(update(this.state, {
    			cards: {
    				$splice: [
    					[dragIndex, 1],
    					[hoverIndex, 0, dragCard]
    				]
    			}
    		}));
    	}

